import React from "react";
import { Link } from "react-router-dom";

const NavItem = ({ title, path }) => {
  return (
    <Link
      key={title}
      id="navItems"
      className="nav-item nav-link"
      data-toggle="collapse"
      data-target=".navbar-collapse.show"
      to={`${path}`}
    >
      {title}
    </Link>
  );
};

export default NavItem;
